import React from "react";
import style from "../style.module.css";

export default function alleryItem({ src, id }) {
  return (
    <li className={style.ImageGalleryItem}>
      <img
        id={id}
        className={style.ImageGalleryItemImage}
        src={src}
        alt="Beautiful"
      />
    </li>
  );
}
